import React, { useState, useRef, useEffect } from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  ActivityIndicator,
  Alert,
  ScrollView,
  Platform,
} from 'react-native';
import { Camera, CameraType } from 'expo-camera';
import * as FileSystem from 'expo-file-system';
import axios from 'axios';
import { Ionicons } from '@expo/vector-icons';
import { useNavigation } from '@react-navigation/native';

interface CameraAnalysisResult {
  heartRate: {
    bpm: number;
    confidence: number;
    variability: number;
  };
  stressLevel: {
    score: number;
    category: 'low' | 'moderate' | 'high';
  };
  skinHealth: {
    score: number;
    concerns: string[];
  };
  eyeHealth: {
    fatigueLevel: number;
    blinkRate: number;
  };
  recommendations: string[];
  timestamp: string;
}

const CameraHealthScreen: React.FC = () => {
  const navigation = useNavigation();
  const cameraRef = useRef<Camera>(null);

  const [hasPermission, setHasPermission] = useState<boolean | null>(null);
  const [isScanning, setIsScanning] = useState(false);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [analysisResult, setAnalysisResult] = useState<CameraAnalysisResult | null>(null);
  const [capturedFrames, setCapturedFrames] = useState<string[]>([]);
  const [scanProgress, setScanProgress] = useState(0);

  const API_URL = process.env.EXPO_PUBLIC_API_URL || 'http://localhost:3000';
  const FRAME_COUNT = 30;
  const FRAME_INTERVAL = 100; // ms

  useEffect(() => {
    requestCameraPermission();
  }, []);

  const requestCameraPermission = async () => {
    const { status } = await Camera.requestCameraPermissionsAsync();
    setHasPermission(status === 'granted');

    if (status !== 'granted') {
      Alert.alert(
        'Camera Permission Required',
        'This feature requires camera access to analyze your health through facial scanning.',
        [{ text: 'OK' }]
      );
    }
  };

  const startScan = async () => {
    if (!cameraRef.current) {
      Alert.alert('Error', 'Camera not ready. Please try again.');
      return;
    }

    setIsScanning(true);
    setScanProgress(0);
    setCapturedFrames([]);
    setAnalysisResult(null);

    const frames: string[] = [];

    try {
      for (let i = 0; i < FRAME_COUNT; i++) {
        const photo = await cameraRef.current.takePictureAsync({
          quality: 0.7,
          base64: true,
          skipProcessing: true,
        });

        if (photo.uri) {
          frames.push(photo.uri);
        }

        setScanProgress(((i + 1) / FRAME_COUNT) * 100);

        // Wait for next frame
        await new Promise((resolve) => setTimeout(resolve, FRAME_INTERVAL));
      }

      setCapturedFrames(frames);
      setIsScanning(false);

      // Start analysis
      await analyzeFrames(frames);
    } catch (error) {
      console.error('Scan failed:', error);
      Alert.alert('Scan Error', 'Failed to capture frames. Please try again.');
      setIsScanning(false);
    }
  };

  const analyzeFrames = async (frames: string[]) => {
    setIsAnalyzing(true);

    try {
      const formData = new FormData();

      // Add frames to form data
      for (let i = 0; i < frames.length; i++) {
        const frameInfo = await FileSystem.getInfoAsync(frames[i]);
        if (frameInfo.exists) {
          formData.append('frames', {
            uri: Platform.OS === 'ios' ? frames[i].replace('file://', '') : frames[i],
            type: 'image/jpeg',
            name: `frame_${i}.jpg`,
          } as any);
        }
      }

      formData.append('frameCount', FRAME_COUNT.toString());
      formData.append('timestamp', new Date().toISOString());

      // Send to backend
      const response = await axios.post(`${API_URL}/api/camera/analyze`, formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
        timeout: 60000, // 60 seconds
      });

      const result: CameraAnalysisResult = response.data;
      setAnalysisResult(result);

      // Clean up frame files
      await cleanupFrames(frames);
    } catch (error) {
      console.error('Analysis failed:', error);

      if (axios.isAxiosError(error)) {
        if (error.code === 'ECONNABORTED') {
          Alert.alert('Timeout', 'Analysis took too long. Please try again.');
        } else if (error.response) {
          Alert.alert('Analysis Error', error.response.data.message || 'Failed to analyze frames.');
        } else if (error.request) {
          Alert.alert('Network Error', 'Could not reach the server. Please check your connection.');
        }
      } else {
        Alert.alert('Error', 'An unexpected error occurred during analysis.');
      }

      // Show mock data for demo in development
      if (__DEV__) {
        setAnalysisResult({
          heartRate: {
            bpm: 72,
            confidence: 0.87,
            variability: 45,
          },
          stressLevel: {
            score: 35,
            category: 'low',
          },
          skinHealth: {
            score: 78,
            concerns: ['Mild dehydration detected', 'Consider more sun protection'],
          },
          eyeHealth: {
            fatigueLevel: 42,
            blinkRate: 18,
          },
          recommendations: [
            'Your heart rate is within normal range.',
            'Stress levels are low - keep up the good work!',
            'Stay hydrated and use sunscreen for better skin health.',
            'Take regular breaks from screens to reduce eye fatigue.',
          ],
          timestamp: new Date().toISOString(),
        });
      }

      await cleanupFrames(frames);
    } finally {
      setIsAnalyzing(false);
    }
  };

  const cleanupFrames = async (frames: string[]) => {
    for (const frame of frames) {
      try {
        await FileSystem.deleteAsync(frame, { idempotent: true });
      } catch (error) {
        console.error('Failed to delete frame:', error);
      }
    }
  };

  const getStressColor = (category: string) => {
    switch (category) {
      case 'low':
        return '#4CAF50';
      case 'moderate':
        return '#FFC107';
      case 'high':
        return '#F44336';
      default:
        return '#999';
    }
  };

  const getHealthScoreColor = (score: number) => {
    if (score >= 75) return '#4CAF50';
    if (score >= 50) return '#FFC107';
    return '#F44336';
  };

  if (hasPermission === null) {
    return (
      <View style={styles.container}>
        <ActivityIndicator size="large" color="#2196F3" />
        <Text style={styles.loadingText}>Requesting camera permission...</Text>
      </View>
    );
  }

  if (hasPermission === false) {
    return (
      <View style={styles.container}>
        <Ionicons name="camera-off" size={80} color="#999" />
        <Text style={styles.errorText}>Camera permission denied</Text>
        <TouchableOpacity style={styles.retryButton} onPress={requestCameraPermission}>
          <Text style={styles.retryButtonText}>Request Permission</Text>
        </TouchableOpacity>
      </View>
    );
  }

  return (
    <View style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <TouchableOpacity onPress={() => navigation.goBack()} style={styles.backButton}>
          <Ionicons name="arrow-back" size={24} color="#333" />
        </TouchableOpacity>
        <Text style={styles.headerTitle}>Camera Health Scan</Text>
        <View style={{ width: 40 }} />
      </View>

      {!analysisResult ? (
        <>
          {/* Camera View */}
          <View style={styles.cameraContainer}>
            <Camera
              ref={cameraRef}
              style={styles.camera}
              type={CameraType.front}
              ratio="16:9"
            >
              <View style={styles.cameraOverlay}>
                <View style={styles.faceBorder} />

                {isScanning && (
                  <View style={styles.scanningIndicator}>
                    <ActivityIndicator size="large" color="#FFFFFF" />
                    <Text style={styles.scanningText}>Scanning... {Math.round(scanProgress)}%</Text>
                    <View style={styles.progressBar}>
                      <View
                        style={[styles.progressFill, { width: `${scanProgress}%` }]}
                      />
                    </View>
                  </View>
                )}
              </View>
            </Camera>
          </View>

          {/* Instructions */}
          <View style={styles.instructionsContainer}>
            <Text style={styles.instructionsTitle}>How to scan:</Text>
            <View style={styles.instruction}>
              <Ionicons name="checkmark-circle" size={20} color="#4CAF50" />
              <Text style={styles.instructionText}>Position your face in the frame</Text>
            </View>
            <View style={styles.instruction}>
              <Ionicons name="checkmark-circle" size={20} color="#4CAF50" />
              <Text style={styles.instructionText}>Ensure good lighting</Text>
            </View>
            <View style={styles.instruction}>
              <Ionicons name="checkmark-circle" size={20} color="#4CAF50" />
              <Text style={styles.instructionText}>Stay still during the scan</Text>
            </View>
          </View>

          {/* Scan Button */}
          {isAnalyzing ? (
            <View style={styles.analyzingContainer}>
              <ActivityIndicator size="large" color="#2196F3" />
              <Text style={styles.analyzingText}>Analyzing your health data...</Text>
            </View>
          ) : (
            <TouchableOpacity
              style={[styles.scanButton, isScanning && styles.scanButtonDisabled]}
              onPress={startScan}
              disabled={isScanning}
            >
              <Ionicons name="scan" size={24} color="#FFFFFF" />
              <Text style={styles.scanButtonText}>
                {isScanning ? 'Scanning...' : 'Start Scan'}
              </Text>
            </TouchableOpacity>
          )}
        </>
      ) : (
        <ScrollView style={styles.resultsContainer} showsVerticalScrollIndicator={false}>
          {/* Heart Rate */}
          <View style={styles.resultCard}>
            <View style={styles.resultHeader}>
              <Ionicons name="heart" size={28} color="#F44336" />
              <Text style={styles.resultTitle}>Heart Rate</Text>
            </View>
            <Text style={styles.resultValue}>{analysisResult.heartRate.bpm} BPM</Text>
            <Text style={styles.resultSubtext}>
              Confidence: {Math.round(analysisResult.heartRate.confidence * 100)}% | HRV:{' '}
              {analysisResult.heartRate.variability}ms
            </Text>
          </View>

          {/* Stress Level */}
          <View style={styles.resultCard}>
            <View style={styles.resultHeader}>
              <Ionicons name="pulse" size={28} color={getStressColor(analysisResult.stressLevel.category)} />
              <Text style={styles.resultTitle}>Stress Level</Text>
            </View>
            <View style={styles.stressIndicator}>
              <Text
                style={[
                  styles.stressCategory,
                  { color: getStressColor(analysisResult.stressLevel.category) },
                ]}
              >
                {analysisResult.stressLevel.category.toUpperCase()}
              </Text>
              <Text style={styles.stressScore}>{analysisResult.stressLevel.score}/100</Text>
            </View>
            <View style={styles.progressBar}>
              <View
                style={[
                  styles.progressFill,
                  {
                    width: `${analysisResult.stressLevel.score}%`,
                    backgroundColor: getStressColor(analysisResult.stressLevel.category),
                  },
                ]}
              />
            </View>
          </View>

          {/* Skin Health */}
          <View style={styles.resultCard}>
            <View style={styles.resultHeader}>
              <Ionicons name="color-palette" size={28} color="#FF9800" />
              <Text style={styles.resultTitle}>Skin Health</Text>
            </View>
            <Text
              style={[
                styles.resultValue,
                { color: getHealthScoreColor(analysisResult.skinHealth.score) },
              ]}
            >
              {analysisResult.skinHealth.score}/100
            </Text>
            {analysisResult.skinHealth.concerns.length > 0 && (
              <View style={styles.concernsContainer}>
                <Text style={styles.concernsTitle}>Concerns:</Text>
                {analysisResult.skinHealth.concerns.map((concern, index) => (
                  <Text key={index} style={styles.concernText}>
                    â€¢ {concern}
                  </Text>
                ))}
              </View>
            )}
          </View>

          {/* Eye Health */}
          <View style={styles.resultCard}>
            <View style={styles.resultHeader}>
              <Ionicons name="eye" size={28} color="#2196F3" />
              <Text style={styles.resultTitle}>Eye Health</Text>
            </View>
            <View style={styles.eyeMetrics}>
              <View style={styles.eyeMetric}>
                <Text style={styles.eyeMetricLabel}>Fatigue Level</Text>
                <Text style={styles.eyeMetricValue}>
                  {analysisResult.eyeHealth.fatigueLevel}%
                </Text>
              </View>
              <View style={styles.eyeMetric}>
                <Text style={styles.eyeMetricLabel}>Blink Rate</Text>
                <Text style={styles.eyeMetricValue}>
                  {analysisResult.eyeHealth.blinkRate}/min
                </Text>
              </View>
            </View>
          </View>

          {/* Recommendations */}
          <View style={styles.recommendationsCard}>
            <Text style={styles.recommendationsTitle}>Health Recommendations</Text>
            {analysisResult.recommendations.map((rec, index) => (
              <View key={index} style={styles.recommendation}>
                <Ionicons name="checkmark-circle" size={20} color="#4CAF50" />
                <Text style={styles.recommendationText}>{rec}</Text>
              </View>
            ))}
          </View>

          {/* Action Buttons */}
          <View style={styles.actionButtons}>
            <TouchableOpacity
              style={styles.scanAgainButton}
              onPress={() => setAnalysisResult(null)}
            >
              <Ionicons name="refresh" size={20} color="#2196F3" />
              <Text style={styles.scanAgainButtonText}>Scan Again</Text>
            </TouchableOpacity>

            <TouchableOpacity
              style={styles.saveButton}
              onPress={() => {
                Alert.alert('Saved', 'Health scan results saved to your profile.');
                navigation.goBack();
              }}
            >
              <Ionicons name="save" size={20} color="#FFFFFF" />
              <Text style={styles.saveButtonText}>Save Results</Text>
            </TouchableOpacity>
          </View>

          <View style={{ height: 40 }} />
        </ScrollView>
      )}
    </View>
  );
};

